import { jsPDF } from "jspdf";

const logo =
  "data:image/png;base64,";
export const createPDF = async (consultation) => {
  return new Promise((resolve) => {
    const addPageIfNeeded = (currentY) => {
      const pageHeight = doc.internal.pageSize.height;
      if (currentY > pageHeight - 20) {
        // 20 mm for margin
        doc.addPage();
        return 10; // Reset y position for new page
      }
      return currentY; // Return updated y position
    };

    const doc = new jsPDF({
      orientation: "portrait",
      unit: "mm",
      format: "a4",
      putOnlyUsedFonts: true,
      floatPrecision: 16,
    });

    // Dimensions du logo
    const logoWidth = 25; // Diminuez la largeur
    const logoHeight = 25; // Diminuez la hauteur
    const logoX = 10; // Position X du logo
    const logoY = 10; // Position Y du logo

    // Ajout du logo
    doc.addImage(logo, "PNG", logoX, logoY, logoWidth, logoHeight);

    // Date  droite du logo
    doc.setFontSize(10);
    doc.setFont("helvetica", "normal");
    const dateX = 200; // Position X de la date
    doc.text(
      `Cotonou, le ${new Date().toLocaleDateString("fr-FR")}`,
      dateX,
      logoY + logoHeight / 2,
      { align: "right" }
    );

    // Titre centr
    doc.setFontSize(14);
    doc.setFont("helvetica", "bold");
    doc.text("CONSULTATION MEDICALE", 105, 40, { align: "center" });

    // Renseignements gnraux
    doc.setFontSize(12);
    doc.setFont("helvetica", "bold");
    doc.text("RENSEIGNEMENTS GENERAUX :", 10, 50);

    // Informations du patient
    doc.setFontSize(10);
    doc.setFont("helvetica", "normal");
    let currentY = 60;
    const infoLines = [
      `NOM: ${consultation.patientInfo.name || "Non prcis"}`,
      `PRENOMS: ${consultation.patientInfo.prenom || "Non prcis"}`,
      `SEXE: ${consultation.patientInfo.gender || "Non prcis"}`,
      `DATE DE NAISSANCE: ${
        consultation.patientInfo.birth
          ? new Date(consultation.patientInfo.birth).toLocaleDateString("fr-FR")
          : "Non prcis"
      }`,
      `ADRESSE: ${consultation.patientInfo.address || "Non prcise"}`,
      `TELEPHONE: ${consultation.patientInfo.phone || "Non prcis"}`,
      `MOTIF DHOSPITALISATION: ${
        consultation.reasonForHospitalization || "Non prcis"
      }`,
    ];

    infoLines.forEach((line) => {
      doc.text(line, 10, currentY);
      currentY += 10; // Increment y position for next line
    });
    // Medical History
    doc.setFontSize(12);
    doc.setFont("helvetica", "bold");
    currentY = addPageIfNeeded(currentY); // Check if we need a new page before the section title
    doc.text("ANAMNESE :", 10, currentY);

    currentY += 10; // Move down for the content
    doc.setFont("helvetica", "normal");

    const medicalHistoryLines = [
      `- Personnel Mdicaux: ${
        consultation.medicalHistory?.personal.join(", ") ||
        "Aucune information disponible."
      }`,
      `- Chirurgicaux: ${
        consultation.medicalHistory?.surgical.join(", ") ||
        "Aucune information disponible."
      }`,
      `- Familiaux:`,
      `  - Ascendants: Pre: ${
        consultation.medicalHistory?.family.father || "Non prcis"
      }, Mre: ${consultation.medicalHistory?.family.mother || "Non prcis"}`,
      `  - Nombre de frres et soeurs: ${
        consultation.medicalHistory?.family.siblings || "Non prcis"
      } enfants`,
      `  - Nombre d'enfants: ${
        consultation.medicalHistory?.family.children || "Non prcis"
      } enfants`,
    ];

    medicalHistoryLines.forEach((line) => {
      currentY = addPageIfNeeded(currentY);
      doc.text(line, 10, currentY);
      currentY += 10; // Increment y position for next line
    });

    // Clinical Exam
    doc.setFontSize(12);
    doc.setFont("helvetica", "bold");
    currentY = addPageIfNeeded(currentY); // Check if we need a new page before the section title
    doc.text("EXAMEN CLINIQUE A LENTREE", 10, currentY);

    currentY += 10; // Move down for the content
    doc.setFont("helvetica", "normal");

    const clinicalExamLines = [
      `Temprature: ${
        consultation.clinicalExamination?.generalCondition.temperature ||
        "Non prcis"
      } C`,
      `TA: ${
        consultation.clinicalExamination?.generalCondition.bloodPressure ||
        "Non prcis"
      } mmHg`,
      `Pouls: ${
        consultation.clinicalExamination?.generalCondition.pulse ||
        "Non prcis"
      } BPM`,
      `FR: ${
        consultation.clinicalExamination?.generalCondition.respiratoryRate ||
        "Non prcis"
      } cpm`,
      `Observations: ${
        consultation.clinicalExamination?.generalCondition.observations ||
        "Aucune"
      }`,
    ];

    clinicalExamLines.forEach((line) => {
      currentY = addPageIfNeeded(currentY);
      doc.text(line, 10, currentY);
      currentY += 10; // Increment y position for next line
    });

    // Complementary Exams
    doc.setFontSize(12);
    doc.setFont("helvetica", "bold");
    currentY = addPageIfNeeded(currentY); // Check if we need a new page before the section title
    doc.text("EXAMENS COMPLEMENTAIRES :", 10, currentY);

    currentY += 10; // Move down for the content
    doc.setFont("helvetica", "normal");

    const complementaryExamLines = [
      `- Biochimie sanguine: ${
        consultation.complementaryExams?.bloodBiochemistry || "Non prcis"
      }`,
      `- Hmogramme: ${
        consultation.complementaryExams?.hemogram || "Non prcis"
      }`,
      `- Srologie: ${
        consultation.complementaryExams?.serology || "Non prcis"
      }`,
      `- Analyse d'urine: ${
        consultation.complementaryExams?.urineAnalysis || "Non prcis"
      }`,
      `- chographie rnale: ${
        consultation.complementaryExams?.renalUltrasound || "Non prcis"
      }`,
      `- Fond d'il: ${
        consultation.complementaryExams?.eyeFundus || "Non prcis"
      }`,
      `- ECG: ${consultation.complementaryExams?.ecg || "Non prcis"}`,
    ];

    complementaryExamLines.forEach((line) => {
      currentY = addPageIfNeeded(currentY);
      doc.text(line, 10, currentY);
      currentY += 10; // Increment y position for next line
    });

    // Conclusion
    doc.setFontSize(12);
    doc.setFont("helvetica", "bold");

    currentY = addPageIfNeeded(currentY); // Check if we need a new page before the section title
    doc.text("CONCLUSION :", 10, currentY);

    currentY += 10; // Move down for the content
    doc.setFont("helvetica", "normal");

    doc.text(
      `${consultation.conclusion || "Aucune information disponible."}`,
      10,
      currentY
    );

    // Save PDF
    const pdfBuffer = doc.output("arraybuffer");
    resolve(pdfBuffer);
  });
};
